license\":\"U\"},\"width\":941,\"height\":704},\"alt\":\"Hen Reproductive System\",\"decorative\":false,\"expandImage\":\"Expand Image\",\"minimizeImage\":\"Minimize Image\"},\"subContentId\":\"71c5d64a-ee1f-414e-bc04-1335ff7cee22\",\"metadata\":{\"contentType\":\"Image\",\"license\":\"U\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.4306151645207439,\"y\":56.237193385218276,\"width\":47.00047696709586,\"height\":43.37099830508475,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Inside the hen's body, the sperms ascend the oviduct to meet a mature ovum. <span style=\\\"color:#c0392b\\\"><strong>Fertilization</strong></span> occurs in the upper part of the oviduct. Once fertilized, the ovum descends down the oviduct and surrounds itself with egg white, a membrane, and a hard shell.</p>\\n\\n<p>Since fertilization occurs inside the female's body, it is an<strong><span style=\\\"color:#c0392b\\\"> internal fertilization.</span></strong></p>\\n\"},\"subContentId\":\"0ac91c0a-ec3c-415d-8740-649e1f4dbbd5\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":64.38942946396865,\"y\":93.13559322033898,\"width\":35.412494134477825,\"height\":6.3653485875706215,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong><span style=\\\"font-size:0.875em\\\">Hen's reproductive system</span></strong></p>\\n\"},\"subContentId\":\"c387c56b-bb72-49f7-9d85-aa17a3f347dd\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":87.1244635193133,\"y\":50.847457627118644,\"width\":12.665713018597996,\"height\":25.00941638418079,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"font-size:0.6875em\\\"><strong>Fertilization is the fusion of a female sex cell with a male sex cell</strong></span></p>\\n\"},\"subContentId\":\"1f9ad05d-5962-493e-8681-9c9fb5738b9a\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}]},{\"elements\":[{\"x\":1.4306151645207439,\"y\":5.649717514124294,\"width\":95.78445407725322,\"height\":39.981167796610166,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Having laid a dozen eggs, the hen sits on them to keep them at a temperature of 38 to 40°C. This is called <span style=\\\"color:#c0392b\\\"><strong>incubation</strong></span>. Incubation lasts 21 days.</p>\\n\\n<p>The laid eggs are rich in nutrients (fats and proteins). During incubation, the growing embryo gradually absorbs these nutrients to grow into a chick.</p>\\n\\n<p>Birds are <span style=\\\"color:#c0392b\\\"><strong>oviparous animals</strong></span> since they reproduce by laying eggs. The offspring develop inside the egg, outside the body of the mother.</p>\\n\"},\"subContentId\":\"627e9f31-fdea-4939-be69-46c2cd604576\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":72.96137339055794  different from the others</li>\\n\\t<li>The adult emerges from the pupa</li>\\n</ul>\\n\"},\"subContentId\":\"fc17cff7-5063-466f-9bf9-4e06a0b9346b\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":48.65278969957082,\"y\":11.280593220338984,\"width\":51.14926094420601,\"height\":64.55743898305084,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>Incomplete metamorphosis</strong></p>\\n\\n<ul>\\n\\t<li>Mostly seen in grasshoppers, locusts, cockroaches and crickets.</li>\\n\\t<li>It includes three stages: Egg; nymph; adult.</li>\\n\\t<li>Growth occurs during nymph stage</li>\\n\\t<li>The nymph resembles the adult but lacks wings</li>\\n\\t<li>The nymph casts off its skin several times during growth</li>\\n</ul>\\n\"},\"subContentId\":\"24b9043b-5abb-44f2-a866-d3868929a0bb\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":47.246065808297566,\"y\":0,\"width\":0.219361087267525,\"height\":67.38229774011299,\"action\":{\"library\":\"H5P.Shape 1.0\",\"params\":{\"line\":{\"borderWidth\":\"1\",\"borderStyle\":\"solid\",\"borderColor\":\"#000\"},\"type\":\"vertical-line\",\"shape\":{\"fillColor\":\"#ffffff\",\"borderColor\":\"#000000\",\"borderWidth\":\"0\",\"borderStyle\":\"solid\",\"borderRadius\":\"0\"}},\"subContentId\":\"082d1809-9a3e-4f62-9f01-354d0edb5aff\",\"metadata\":{\"contentType\":\"Shapes\",\"license\":\"U\",\"title\":\"Untitled Shapes\"}},\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false},{\"x\":0,\"y\":67.79661016949153,\"width\":100,\"height\":0.433145197740113,\"action\":{\"library\":\"H5P.Shape 1.0\",\"params\":{\"line\":{\"borderWidth\":\"1\",\"borderStyle\":\"solid\",\"borderColor\":\"#000\"},\"type\":\"horizontal-line\",\"shape\":{\"fillColor\":\"#ffffff\",\"borderColor\":\"#000000\",\"borderWidth\":\"0\",\"borderStyle\":\"solid\",\"borderRadius\":\"0\"}},\"subContentId\":\"04bc3228-ab58-4832-a322-a9150d405732\",\"metadata\":{\"contentType\":\"Shapes\",\"license\":\"U\",\"title\":\"Untitled Shapes\"}},\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false}]},{\"elements\":[{\"x\":1.4306151645207439,\"y\":2.8248587570621475,\"width\":68.45970443490701,\"height\":8.06026384180791,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"font-size:1.25em\\\"><strong><span style=\\\"background-color:#f1c40f\\\">   Reproduction in Mammals   </span></strong></span></p>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"7586d536-6e88-406d-9266-b137bc2df788\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.4306151645207439,\"y\":11.242937853107343,\"width\":97.5011922746781,\"height\":19.359698870056494,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Mammals are <span style=\\\"color:#c0392b\\\"><strong>vertebrates</strong></span> that <span style=\\\"color:#c0392b\\\"><strong>reproduce sexually</strong></span>. Fertilization is<strong><span style=\\\"color:#c0392b\\\"> internal</span></strong> and occurs when the male and the female mate. Fertilization results in the formation of a <span style=\\\"color:#c0392b\\\"><strong>zygote</strong></span> that develops into an embryo, and then into a new individual. The development of the new individual occurs inside the uterus of the mother and it takes a specific duration called <span style=\\\"color:#c0392b\\\"><strong>gestation period</strong></span>.</p>\\n\\n<p> </p>\\n\"},\"subContentId\":\"6d4bb5d6-00ae-4561-86af-54a2022fbda7\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":57.25321888412017,\"y\":47.97542372881356,\"width\":42.56556995708155,\"height\":51.56308870056497,\"action\":{\"library\":\"H5P.Table 1.1\",\"params\":{\"text\":\"<table>\\n\\t<thead>\\n\\t\\t<tr>\\n\\t\\t\\t<th scope=\\\"col\\\"><span style=\\\"color:#16a085\\\">Animal</span></th>\\n\\t\\t\\t<th scope=\\\"col\\\"><span style=\\\"color:#16a085\\\">Gestation period (in days)</span></th>\\n\\t\\t</tr>\\n\\t</thead>\\n\\t<tbody>\\n\\t\\t<tr>\\n\\t\\t\\t<td style=\\\"text-align:center\\\">Cat</td>\\n\\t\\t\\t<td style=\\\"text-align:center\\\">65</td>\\n\\t\\t</tr>\\n\\t\\t<tr>\\n\\t\\t\\t<td style=\\\"text-align:center\\\">Ewe</td>\\n\\t\\t\\t<td style=\\\"text-align:center\\\">155</td>\\n\\t\\t</tr>\\n\\t\\t<tr>\\n\\t\\t\\t<td style=\\\"text-align:center\\\">Mare</td>\\n\\t\\t\\t<td style=\\\"text-align:center\\\">340</td>\\n\\t\\t</tr>\\n\\t\\t<tr>\\n\\t\\t\\t<td style=\\\"text-align:center\\\">Cow</td>\\n\\t\\t\\t<td style=\\\"text-align:center\\\">275</td>\\n\\t\\t</tr>\\n\\t\\t<tr>\\n\\t\\t\\t<td style=\\\"text-align:center\\\">Elephant</td>\\n\\t\\t\\t<td style=\\\"text-align:center\\\">625</td>\\n\\t\\t</tr>\\n\\t\\t<tr>\\n\\t\\t\\t<td style=\\\"text-align:center\\\">Camel</td>\\n\\t\\t\\t<td style=\\\"text-align:center\\\">410</td>\\n\\t\\t</tr>\\n\\t</tbody>\\n</table>\\n\"},\"subContentId\":\"5b912064-dd05-45b3-9756-888bd84eb5ae\",\"metadata\":{\"contentType\":\"Table\",\"license\":\"U\",\"title\":\"Untitled Table\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Untitled Table\"}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.4306151645207439,\"y\":48.0225988700565,\"width\":52.72293762517883,\"height\":8.06026384180791,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Mammals give birth to live offspring: they are <span style=\\\"color:#c0392b\\\"><strong>viviparous.</strong></span></p>\\n\"},\"subContentId\":\"f2eaa1e2-37ac-4291-9f69-688c13c549c4\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.0014306151645207,\"y\":33.898305084745765,\"width\":98.78874592274677,\"height\":16.53484011299435,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>The uterus of the mother provides the growing individual with suitable conditions for normal growth. Some of the most important conditions are nutrition, respiration, appropriate temperature and protection.</p>\\n\"},\"subContentId\":\"5ed8af4a-00c0-48b0-b9f0-1836058b6c56\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":12.875536480686694,\"y\":56.497175141242934,\"width\":26.971864663805434,\"height\":35.46139378531073,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/jpeg;base64,/9j/4AAQSkZJRgABAQAAAQABAAD/2wBDAAMCAgICAgMCAgIDAwMDBAY ",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{}},{\"slideBackgroundSelector\":{},\"elements\":[{\"x\":1.4306151645207439,\"y\":2.8248587570621475,\"width\":68.45970443490701,\"height\":8.06026384180791,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"font-size:1.25em\\\"><strong><span style=\\\"background-color:#f1c40f\\\">   Aspects of Adaptation   </span></strong></span></p>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"742be966-61ef-4503-bec2-3e82b18faeda\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.4306151645207439,\"y\":14.096045197740112,\"width\":55.58416795422032,\"height\":85.46139378531075,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Animals do not take care of their offspring the same way.</p>\\n\\n<p>Insects do not usually take care of their offspring, but they lay a very large number of eggs to make sure that at least a few will survive till adulthood. They also lay them where the larvae can find food as soon as the eggs hatch.</p>\\n\\n<p>Birds show some kind of parenthood. They build well hidden nests where the female lays 2 to 15 eggs depending on the species. And then she incubates them until hatching. Chicks are fed, protected and kept warm in the nest until they can fly and nourish themselves.</p>\\n\\n<p>Mammals are the type of animals that spend a lot of time and energy in parenthood. They have a few offspring. They clean they young right after delivery. They breastfeed them, protect them and teach them how to live on their own before they leave them.</p>\\n\"},\"subContentId\":\"61b6d4bd-0e93-4d01-8b36-4af380617ba6\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":57.22460658082976,\"y\":67.79661016949153,\"width\":19.96185035765379,\"height\":29.529190395480224,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/jpeg;base64,/9j/4AAQSkZJRgABAQEBLAEsAAD/4QEZRXhpZgAATU0AKgAAAAgABAEPAAIAAAAYAAAAPgEQAAIAAAARAAAAVoKaAAUAAAABAAAAZ4dpAAQAAAABAAAAbwAAAABPTFlNUFVTIENPUlBPUkFUSU9OICAgIABFLU0xTWFya0lJICAgICAgAAAAAAEAAACgAAeCmgAFAAAAAQAAAMWCnQAFAAAAAQAAAM2IJwADAAAAAgH0AACQAwACAAAAFAAAANWSCQADAAAAAgAIAACSCgAFAAAAAQAAAOmkNAACAAAAIAAAAPEAAAABAAAAoAAAADgAAAAKMjAxOToxMToxNyAxMTozMDozOQAAAADCAAAAAU0uNDAtMTUwbW0gRjIuOCArIE1DLTIwAAAAAAAAAAAA/9sAQwADAgICAgIDAgICAwMDAwQGBAQEBAQIBgYFBgkICgoJCAkJCgwPDAoLDgsJCQ0RDQ4PEBAREAoMEhMSEBMPEBAQ/9sAQwEDAwMEAwQIBAQIEAsJCxAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQEBAQ/8AAEQgDuwUAAwEiAAIRAQMRAf/EAB0AAAIDAQEBAQEAAAAAAAAAAAUGAwQHAggBAAn/xABLEAABAwIFAgQEBAQFBAECAA8BAgMEBREABhIhMRNBByJRYRQycYEVI0KRCKGxwRZS0eHwJDNi8XIXJUOCNCZTkqIJshg1NkRj0v/EABwBAAIDAQEBAQAAAAAAAAAAAAQFAgMGAQAHCP/EAEQRAAECBQIDBgUEAgIABgEBCQECEQADBCExEkEFUWETInGBkfAGMqGxwRTR4fEjQhVSByQzYnKCFpKiFzRDU7LC0uL/2gAMAwEAAhEDEQA/AAmVKZ8FRZC5VLR+JOklsja5P9LHnELUWkTJzL8hLb76CULfa/W4k7pT/wCAI+5BvthZqueX4eYoeWsxNTozLigGZbLK1MLubWW4PlNvUjb1wRzhWKLSISaNlKKpxkKSp5xA+clW6SeQkfqPJuPXGeXTTJEpOtNj5W3Y9bWbYuOY9LWJnrUJZ1BINicuzEgDLvno0F8zZrrdDgNHJdGiTZ0t5KGw+5p6qbjUU2vbY/MRb0GDsajPsTEz6ypKZMlIGytwfb0wsN1VFPoX4yin/EVNZDaX9IKUH0T62H22xdbzlFpkeLVar1Jk91ehmOm6lqUR2A+l8enBdRTASjpLt1a2+wDWJxd4Kpa6Vwmf2VaBZJW/2fm5wB9TE3iDlqg5dgP5jq9VdS2Gzoja7qecPAHfm24wCy
